      SELECT DISTINCT + col2 FROM tab0 (FORMAT parquet) WHERE - col2 NOT IN ( - ( + + col0 ), + col2, + 51 * + + col0, - col2 * col2 );
  - name: tab0

outputs:
  - name: q12495.out
    data: |
      10
      47
      99
